import React from 'react'
import '../App.css';
export default function Todoli(props) {

    const {todoarr} = props;
    const  handleUl = props.handleUl;
    const {handleUldouble} = props;
    const ul = props.UL;
    return (
        <div>
            <ul id="todos">
            {todoarr.map((val, index) => (
  <li
    key={index} // Add a unique key based on the index of the item
    onClick={handleUl}
    onDoubleClick={handleUldouble}
    className="li_class"
  >
    {val}
  </li>
))}
                ))}
            </ul>
        </div>
    )
}


